import React, { useState, useEffect } from 'react';
import { chatsAPI } from '../services/api';
import { Chat } from '../types';
import ChatComponent from '../components/Chat';

const ChatList: React.FC = () => {
  const [chats, setChats] = useState<Chat[]>([]);
  const [selectedChat, setSelectedChat] = useState<Chat | null>(null);
  const [loading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<string>('');

  useEffect(() => {
    loadChats();
  }, []);

  const loadChats = async () => {
    try {
      setLoading(true);
      const response = await chatsAPI.getAll();
      setChats(response.data);
    } catch (err: any) {
      setError('Failed to load chats. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleChatSelect = (chat: Chat) => {
    setSelectedChat(chat);
  };

  const handleCloseChat = () => {
    setSelectedChat(null);
  };

  if (loading) {
    return (
      <div className="container">
        <div style={{ textAlign: 'center', marginTop: '50px' }}>
          <div className="spinner-border" role="status">
            <span className="sr-only">Loading...</span>
          </div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container">
        <div className="alert alert-danger">
          {error}
        </div>
      </div>
    );
  }

  return (
    <div className="container">
      <div style={{ maxWidth: '800px', margin: '50px auto' }}>
        <div className="card">
          <div className="card-header">
            <h2 style={{ margin: '0' }}>My Chats</h2>
          </div>
          
          <div className="card-body">
            {chats.length === 0 ? (
              <div style={{ textAlign: 'center', padding: '40px' }}>
                <p style={{ color: '#666', fontSize: '16px' }}>
                  No chats yet. Start a skill swap to begin chatting!
                </p>
              </div>
            ) : (
              <div style={{ display: 'flex', gap: '20px' }}>
                {/* Chat List */}
                <div style={{ flex: '1', maxWidth: '300px' }}>
                  <h4>Conversations</h4>
                  <div style={{ maxHeight: '400px', overflowY: 'auto' }}>
                    {chats.map((chat) => (
                      <div
                        key={chat.id}
                        onClick={() => handleChatSelect(chat)}
                        style={{
                          padding: '15px',
                          border: '1px solid #ddd',
                          borderRadius: '8px',
                          marginBottom: '10px',
                          cursor: 'pointer',
                          backgroundColor: selectedChat?.id === chat.id ? '#f8f9fa' : 'white',
                          transition: 'background-color 0.2s'
                        }}
                      >
                        <div style={{ fontWeight: 'bold', marginBottom: '5px' }}>
                          {chat.participant_names.join(' & ')}
                        </div>
                        <div style={{ fontSize: '12px', color: '#666' }}>
                          No messages yet
                        </div>
                      </div>
                    ))}
                  </div>
                </div>

                {/* Chat Component */}
                {selectedChat && (
                  <div style={{ flex: '2' }}>
                    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '15px' }}>
                      <h4>Chat with {selectedChat.participant_names.join(' & ')}</h4>
                      <button
                        onClick={handleCloseChat}
                        className="btn btn-sm btn-outline-secondary"
                      >
                        Close
                      </button>
                    </div>
                    <ChatComponent 
                      chatId={selectedChat.id} 
                      participants={selectedChat.participant_names.map((name, index) => ({ 
                        id: selectedChat.participants[index], 
                        username: name 
                      }))}
                    />
                  </div>
                )}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ChatList;
